0e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"56046","type":"Paragraph"},{"attributes":{"overlay":{"id":"55386"}},"id":"55382","type":"BoxZoomTool"},{"attributes":{},"id":"55383","type":"SaveTool"},{"attributes":{},"id":"55384","type":"ResetTool"},{"attributes":{},"id":"55385","type":"HelpTool"},{"attributes":{"source":{"id":"55693"}},"id":"55697","type":"CDSView"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"55694","type":"Line"},{"attributes":{},"id":"56086","type":"BasicTickFormatter"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"55914"},{"id":"55915"},{"id":"55916"},{"id":"55917"},{"id":"55918"},{"id":"55919"},{"id":"55940"}]},"id":"55921","type":"Toolbar"},{"attributes":{"data":{"x":{"__ndarray__":"AABAcmUNd0IAAADYtw13QgAAwD0KDndCAACAo1wOd0IAAEAJrw53QgAAAG8BD3dCAADA1FMPd0IAAI
